import "../index.css";
import { Link, useNavigate } from "react-router-dom";
import { Icon } from '@iconify/react';
import { useState } from "react";

const CartButton = ({callback}) => {
    const [color, setColor] = useState("#344648");
    return (
        <div className="thrash-can" onClick={callback}>
            <button onMouseEnter={() => setColor("#C0A9BD")} onMouseLeave={() => setColor("#94A7AE")}>
                <Icon icon="bx:cart" color={color} width="40" height="40"/>
            </button>
        </div> 
    )
}

function NavigationMenu ({loggedIn}) {
	const navigate = useNavigate();
	return (
		<div className="navigation-menu">
			{loggedIn.length === 0 &&
				<button onClick={() => navigate("/login")} className="nav-button"> Login </button>
			}
			{loggedIn.length !== 0 &&
				<button onClick={() => navigate("/update_info")} className="nav-button"> Usu√°rio </button>
			}
			<CartButton callback={() => navigate("/cart")}/>
		</div>
	)
}

function Header({loggedIn}) {
	return (
		<header>
			<div className="header left flex-box">
				<div className="logo">
					<h1>GoodGlassesGG</h1>
				</div>
				<NavigationMenu/>
			</div>
		</header>
	);
};

export default Header;
